Head: First flagellomere covered by pale microsetulae. Frontal vitta with a darkened spot anterior to ocellar plate. Frontal vitta flat, not swollen anterior to ocellar plate. Epicephala merging immediately posterior to ocellar plate (
Fig. 49
). Epicephalon flat, same level as frontal vitta.

Abdomen: Pleural membrane with white bands on P1 and P3 (
Fig. 52
). Female abdomen: Single spermathecal duct with an apical small rounded swelling. Single spermatheca cylindrical, basally tapered and broadened on apical half with small rounded processes (
Fig. 50
). Paired spermathecal duct slightly broadened apically before splitting into stems. Paired spermathecal duct stems tapered on basal third, broad on apical half and slightly convoluted. Paired spermathecae oval, deeply invaginated apically. Male abdomen: Copulatory fork with quadrate inner basal lobes (
Fig. 52
). Ejaculatory apodeme bigger than epandrium; blade about as long as sperm pump. Phallapodeme short, not extending to anterior limit of hypandrium. Distiphallus long, longer than epandrium, phallic bulb cylindrical, subequal in width and length. Distal distiphallus short and thin, 1/4 of length and almost half of width of basal distiphallus.
